import "./Navbar.css";
export const Navbar = () => {
  return (
    <div className="navbarlayout">
      <div className="navbar-div">
        <div>Xelpmoc Design And Tech Limited</div>
        <div className="register-login">
          <div className="register">Register</div>
          <div className="login">Login</div>
        </div>
      </div>
    </div>
  );
};
